import ExpensiveItem from './ExpensiveItem'
import './Expenses.css'
import ExpensesFilter from './ExpensesFilter'
import Card from '../UI/Card'
import {useState} from 'react';

const Expenses = (props) => {
    const [actualYear, setYear] = useState('2021');
    const selectedChangeYear= (year) =>{
        setYear(year);
        console.log(year);
    }
    return(
        <Card className="expenses">
            <ExpensesFilter actualYear={actualYear} dropChange={selectedChangeYear}/>
            {()=>{}}
            <ExpensiveItem title={props.data[0].title} price={props.data[0].price} date={props.data[0].date}/>
            <ExpensiveItem title={props.data[1].title} price={props.data[1].price} date={props.data[1].date}/>
            <ExpensiveItem title={props.data[2].title} price={props.data[2].price} date={props.data[2].date}/>
        </Card>
    );
}
export default Expenses;
